import { Spinner } from 'react-bootstrap'
export default function MySpinner() {
  return (
    <div style={{'width' : '100%', 'height' : '80vh', 'verticalAlign' : 'middle'}}>
        <center>
            <Spinner animation="border" style={{'marginTop' : '2px','width' : '50px', 'height' : '50px'}} variant=''/>
        </center>
    </div>
  )
}
